import styled from "styled-components";

export const MainContainer = styled.div`
  max-width: 1200px;
  margin: auto;
`;
export const Logo = styled.div`
  > span:first-child {
    height: 5px;
    width: 5px;
    background-color: black;
    border-radius: 50px;
    display: inline-block;
  }
`;
